import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Importar pÃ¡ginas
import HomePage from './pages/HomePage';
import CatalogPage from './pages/CatalogPage';
import AboutUsPage from './pages/AboutUsPage';
import ContactPage from './pages/ContactPage';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import ResetPasswordPage from './pages/ResetPasswordPage';

function App() {
  return (
    <Router>
      <div className="app">
        <header className="header">
          <div className="header-content">
            <Link to="/" className="logo">
              <img src="/logo.png" alt="El Taller del Maestro" />
            </Link>
            <nav className="main-menu">
              <Link to="/">Inicio</Link>
              <Link to="/catalogo">CatÃ¡logo</Link>
              <Link to="/nosotros">QuiÃ©nes Somos</Link>
              <Link to="/contacto">ContÃ¡ctenos</Link>
            </nav>
            <div className="user-menu">
              <Link to="/carrito" className="cart-icon">ðŸ›’<span className="cart-count">0</span></Link>
              <Link to="/cuenta" className="account-icon">ðŸ‘¤</Link>
            </div>
          </div>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/catalogo" element={<CatalogPage />} />
            <Route path="/nosotros" element={<AboutUsPage />} />
            <Route path="/contacto" element={<ContactPage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/registro" element={<SignupPage />} />
            <Route path="/reset-password" element={<ResetPasswordPage />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
